function str_insert(str,ch,pos)
{
	return(str.slice(0,pos-1)+ch+str.slice(pos-1));
}

function parseDictPronunciation()
{
	for(var i=0;i<dictionary.length;i+=1)
	{
		for(var j=0;j<dictionary[i].length;j+=1)
		{
				dictionary[i][j][0]=replaceAll("'","ˈ",dictionary[i][j][0]);
				dictionary[i][j].push(dictionary[i][j][0]);
				dictionary[i][j][0]=replaceAll("ˈ","",dictionary[i][j][0]);
				dictionary[i][j][0]=replaceAll(".","",dictionary[i][j][0]);
		}
		dictionary[i].sort(function(a,b){
			var c=searchRemoveDiacritics(a[0]).toUpperCase();
			var d=searchRemoveDiacritics(b[0]).toUpperCase();
			return c<d ? -1 : c>d ? 1 : 0;
			});
	}
}

