function applyAllophones(str,before,after,l,r)
{
	str=" "+str+" ";
	for(var i=0;i<l.length;i++)
	{
		for(var j=0;j<r.length;j++)
		{
			str=replaceAll(l[i]+before+r[j],l[i]+after+r[j],str);
			str=replaceAll(l[i]+"."+before+r[j],l[i]+"."+after+r[j],str);
			str=replaceAll(l[i]+before+"."+r[j],l[i]+after+"."+r[j],str);
		}
	}
	return(str.trim());
}

